%pyspark

max_items = 100
for idx in range (0, 42):
  items = csv_rdd.map(lambda x: x[idx]).distinct().count()

  if items <= max_items:
     print 'field %d: %d distinct items %s' % (idx, items, csv_rdd.map(lambda x: x[idx]).distinct().collect())
     if items >= 25:  print ' '
  else:
     print 'field %d: %d distinct items (more than %d is too many to print)' % (idx, items, max_items)
